import React from "react";
import {
    MailOutlined,
    PhoneOutlined,
    HomeOutlined,
    InstagramOutlined,
    LinkedinOutlined,
    FacebookOutlined
} from "@ant-design/icons";

const Contact = () => {
    return (
        <div className="h-full w-full flex justify-center items-center">
            <div className="flex w-3/5 h-3/5 bg-gray-900 rounded-lg text-white">
                <div className="flex flex-col w-1/2 px-12 py-8 space-y-12 justify-between">
                    <div><p className="text-3xl">Laten we kijken of we samen wat moois kunnen maken!</p></div>
                    <div className="flex flex-col justify-between">
                        <div className="w-full flex justify-between"><MailOutlined/><p>info@vkvrestauraties.nl</p></div>
                        <div className="w-full flex justify-between"><PhoneOutlined/><p>+31 6 52418553</p></div>
                        <div className="w-full flex justify-between"><HomeOutlined/><p>van Ostadestraat 176,
                            Amsterdam</p></div>
                    </div>
                    <div className="flex space-x-4 w-full">
                        <InstagramOutlined /> <LinkedinOutlined /> <FacebookOutlined />
                    </div>
                </div>
                <div className="w-1/2">

                </div>
            </div>
        </div>
    );
}

export default Contact;
